(3, '<h1><span style="text-decoration: underline;"><strong>Welcome Naveen to IZ Family</strong></span></h1>\r\n<p><br /><img src="data:image/png;base64," alt="" /><br /><br /></p>\r\n<!-- [if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>EN-US</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables/>\r\n   <w:SnapToGridInCell/>\r\n   <w:WrapTextWithPunct/>\r\n   <w:UseAsianBreakRules/>\r\n   <w:DontGrowAutofit/>\r\n   <w:SplitPgBreakAndParaMark/>\r\n   <w:DontVertAlignCellWithSp/>\r\n   <w:DontBreakConstrainedForcedTables/>\r\n   <w:DontVertAlignInTxbx/>\r\n   <w:Word11KerningPairs/>\r\n   <w:CachedColBalance/>\r\n  </w:Compatibility>\r\n  <m:mathPr>\r\n   <m:mathFont m:val="Cambria Math"/>\r\n   <m:brkBin m:val="before"/>\r\n   <m:brkBinSub m:val="--"/>\r\n   <m:smallFrac m:val="off"/>\r\n   <m:dispDef/>\r\n   <m:lMargin m:val="0"/>\r\n   <m:rMargin m:val="0"/>\r\n   <m:defJc m:val="centerGroup"/>\r\n   <m:wrapIndent m:val="1440"/>\r\n   <m:intLim m:val="subSup"/>\r\n   <m:naryLim m:val="undOvr"/>\r\n  </m:mathPr></w:WordDocument>\r\n</xml><![endif]-->\r\n<h2 class="MsoNormal"><strong>Naveen Kaushik &ndash; Head Technology, Input Zero Technologies Pvt. Ltd.&lt;&lt;&lt;&lt;&lt;</strong></h2>\r\n<p><strong>&gt;&gt;&gt;&gt;&gt;at Bangalore<br /></strong></p>\r\n<p class="MsoNormal" style="margin-bottom: .0001pt; text-align: justify; line-height: normal; tab-stops: list .3in;"><span style="font-size: 10.0pt;">N<strong>aveen has 10 years IT Industry Experience and has great in Due Diligence, Solution and Architectural Design, Technical Project Deliveries.</strong></span></p>\r\n<p class="MsoNormal" style="margin-bottom: .0001pt; text-align: justify; line-height: normal; tab-stops: list .3in;"><strong><span style="font-size: 10pt;">&nbsp;</span></strong></p>\r\n<p class="MsoNormal" style="margin-bottom: .0001pt; text-align: justify; line-height: normal; tab-stops: list .3in;"><strong><span style="font-size: 10pt;">He brings experience in Process, Functional Specification Designing, Technical Design , Solution Presentation, Articulating Bill of Material in term of Process, Tool, Resources (Cost/Time), Technical Project Planning &amp; Management, Tool Evaluation, Implementation Assessment, Application Integration Design (BMC Family Tools and Third Party Tools).</span></strong></p>\r\n<p class="MsoNormal" style="margin-bottom: .0001pt; text-align: justify; line-height: normal; tab-stops: list .3in;"><strong><span style="font-size: 10pt;">&nbsp;</span></strong></p>\r\n<p class="MsoNormal" style="margin-bottom: .0001pt; text-align: justify; line-height: normal; tab-stops: list .3in;"><strong><span style="font-size: 10pt;">He possesses e</span><span style="font-size: 10pt;">xtensive Hands on experience of RFP Response, Solution Defense Workshops, Senior Management Customer Interfacing , Design and Implementation experience of Single Sign On and SSL solutions having great exposure across industry ITSM Solutions BMC Remedy ITSM and Atrium CMDB. </span></strong></p>\r\n<p class="MsoNormal" style="margin-bottom: .0001pt; text-align: justify; line-height: normal; tab-stops: list .3in;"><strong><span style="font-size: 10pt;">&nbsp;</span></strong></p>\r\n<p class="MsoNormal" style="margin-bottom: .0001pt; text-align: justify; line-height: normal; tab-stops: list .3in;"><strong><span style="font-size: 10pt;">He has expertise in customization &amp; implementation of BMC Remedy AR System, BMC Remedy ITSM Suite, BMC Atrium CMDB and&nbsp; has worked on ARS versions 5.1.2, 6.3, 7.0, 7.1,7.6.x ITSM versions 5.1, 6.0,7.0.x, 7.6.x, 8.x along with CMDB 2.0, 2.2, 7.1, 7.6.x.&nbsp; He has been involved developing, customizing Incident Management, Problem Management, Change Management, Release Management, CMDB, Asset Management, Service Request, Procurement Management, Purchase Requisition, Purchase Order and SLM, integrating Remedy with various tools.</span></strong></p>\r\n<p class="MsoNormal" style="margin-bottom: .0001pt; text-align: justify; line-height: normal; tab-stops: list .3in;"><strong><span style="font-size: 10pt;">&nbsp;</span></strong></p>\r\n<p class="MsoNormal" style="margin-bottom: .0001pt; text-align: justify; line-height: normal; tab-stops: list .3in;"><strong><span style="font-size: 10pt;">His skills are complemented by good exposure to </span><span style="font-size: 10pt;">Onsite Requirement Analysis &amp; Existing System Study and Knowledge Transition / training operation team and having hands on experience in setting up Disaster recovery setup, SSO, SSL for remedy platform</span><span style="font-size: 10pt;"> along with </span><span style="font-size: 10pt;">consulting experience in Performance Tuning, Operational Procedure Design, application Health Check.</span></strong></p>', 'welcome naveen to iz family\r\n\r\n\r\nnaveen kaushik  head technology, input zero technologies pvt ltdat bangalore\r\nnaveen has 10 years it industry experience and has great in due diligence, solution and architectural design, technical project deliveries\r\n\r\nhe brings experience in process, functional specification designing, technical design , solution presentation, articulating bill of material in term of process, tool, resources costtime, technical project planning  management, tool evaluation, implementation assessment, application integration design bmc family tools and third party tools\r\n\r\nhe possesses extensive hands on experience of rfp response, solution defense workshops, senior management customer interfacing , design and implementation experience of single sign on and ssl solutions having great exposure across industry itsm solutions bmc remedy itsm and atrium cmdb \r\n\r\nhe has expertise in customization  implementation of bmc remedy ar system, bmc remedy itsm suite, bmc atrium cmdb and has worked on ars versions 512, 63, 70, 71,76x itsm versions 51, 60,70x, 76x, 8x along with cmdb 20, 22, 71, 76x he has been involved developing, customizing incident management, problem management, change management, release management, cmdb, asset management, service request, procurement management, purchase requisition, purchase order and slm, integrating remedy with various tools\r\n\r\nhis skills are complemented by good exposure to onsite requirement analysis  existing system study and knowledge transition  training operation team and having hands on experience in setting up disaster recovery setup, sso, ssl for remedy platform along with consulting experience in performance tuning, operational procedure design, application health check', 2, '', '', 0, 0);
